def minimumAbsDifference(arr: 'List[int]'):
    t = sorted(arr)
    m = float('inf')
    output = []
    for i in range(len(t)-1):
        if abs(t[i + 1] - t[i]) < m:
            m = abs(t[i + 1] - t[i])
            output = []
            output.append([t[i],t[i+1]])
        elif abs(t[i + 1] - t[i]) == m:
            output.append([t[i], t[i + 1]])

    return output




